import React from 'react';
import {Grid} from '@material-ui/core'; 
import Product from './Product/Product';

const products = [
    { id: 1, name: 'iphone 11', description: 'Apple iphone 11 ', price:'$46', image:'data:image/jpeg;base64,' },
    { id: 2, name: 'Samsung Galaxy S21 Ultra', description: 'Samsung Galaxy S21 Ultra', price:'$50', image:'data:image/jpeg;base64,'},
    { id: 3, name: 'iphone 11', description: 'Apple iphone 11 ', price:'$46', image:'data:image/jpeg;base64,' },
    { id: 4, name: 'Samsung Galaxy S21 Ultra', description: 'Samsung Galaxy S21 Ultra', price:'$50', image:'data:image/jpeg;base64,'},
    { id: 5, name: 'iphone 11', description: 'Apple iphone 11 ', price:'$46', image:'data:image/jpeg;base64,' },
    { id: 6, name: 'Samsung Galaxy S21 Ultra', description: 'Samsung Galaxy S21 Ultra', price:'$50', image:'data:image/jpeg;base64,'},

]

const Products = () => {
    return (
        <main>
            <Grid container justify='center' spacing={6}> 
                {products.map((product) => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3} >
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    )
}

export default Products;
